import React,{useState} from 'react'
import { useStyles } from '../../styles/styles';
import { Button, TextField, Card } from "@material-ui/core";
import {Link } from "react-router-dom";
import {RegisterActionAddress} from '../../redux/actions/AuthActions';
import {useDispatch} from 'react-redux';



function AddressComponent(){

  fetch("http://localhost:3000/api/users/address", {
    method: "GET",
    mode: "no-cors",
    headers: {
      Accept: "application/json, text/plain, */*",
      // "Content-Type": "application/json",
      Authorization: "Bearer " + "eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiJ9.eyJhdWQiOiIxIiwianRpIjoiZTFmZjc0YWZiYjUzMGE1MWUyNWY4ODAzYjE1NjU1OTEyODQ5NjZiZTdjZjM2M2ZkOGJkNDFlNzg3NTNkZGNkMjQ4NDEzNjFkMTNiZTQ4ZTgiLCJpYXQiOjE2MjEzMDAwMTEuMzE5NDI1LCJuYmYiOjE2MjEzMDAwMTEuMzE5NDMzLCJleHAiOjE2NTI4MzYwMTEuMzEwODM2LCJzdWIiOiIxIiwic2NvcGVzIjpbXX0.pyoQcln1cD98yDixefvubQvVKKJsCWlYgR42z6d74U-ACjjWBQU2qAuIDhK2qg4Knw_hxZ64s6QiWn4zfIkLtRhoHrIU7cKGqrrlxb_6cJ3VIMP1lk0nrTY-DY2xVNGAb8ZfJERYPGClQu_aAq-SuSiQfT7jsckpz6gsEWhFOMG5gnYLg51Km8Gb2aiu798UfOPydi9eKUYLK39qI6R1sUTHC342L5H09QlNVKg5bSLJchaD3RAQewJcswg_xJFeZ0urt0j3VU00efneuIBvu_xWJeYymqqCXnzWDPwRWTec30ysQGQcHiYFzDwgYSyXyJdzJnPtWkTApbJ44JdjJUBoEEMnyaZMg7MVz0p-gMh7TsLNjpms9FQ_aAbHQpyBkoNDzvYcqtzl06u9sdrbT7C_aoqOsfblKd6RPGsQBYEHV_DUkeO5LTdUX9ey1ZWXyWZ-FXQU_cudSpkiG0tAUk0yQUrljVYRUnh73cDiXOV2zH6tvidWUBws9dB2Mlgxy4zyIm7uM2gDzh4RjROOmCyfczQUrQZ6c8SLGS7pbLUvQbWy8bnB45jrQ7M_Axh6me4oNEqzpjoSI3kcOowEroSe7GhqPXtL6w5nilDpvqREMc9louM9e0TQ98ZqMN8ouQ1CN5XmHaYV4M8h6-otw4utZuqLOZ6IKZKXop7P8y0",
    },
  })
    .then((res) => res.json())
    .then(
      (tasks) =>
        this.setState({
          tasks,
        }),
      console.log(),
    );

  const classes = useStyles();

  const dispatch = useDispatch();

  const [fields, setState] = useState({
    address: "",
  });

  const handleFieldChange = e => {
      setState({
          ...fields,
          [e.target.id] : e.target.value
      })
  }
  const UserRegisterAddress = (e) => {
    e.preventDefault();
    console.log(fields);
    dispatch(RegisterActionAddress(fields));
  };
  
  return(
    <div>
      <div className={classes.centerItem}>
        <Card>
          <h2>
            <b>Endereço</b>
          </h2>

          <form onSubmit={UserRegisterAddress}>
            <div>
              <TextField
                type="number"
                className={classes.fullWidth}
                required
                margin="normal"
                variant="outlined"
                label="Cep"
                id="address"
                value={fields.address}
                onChange={handleFieldChange}
                inputProps={{ maxLength: 8 }}
              />
            </div>
            <div>
              <div>
                <Button
                  type="submit"
                  className={classes.fullWidth}
                  variant="contained"
                  color="primary"
                >
                  <b>Cadastrar</b>
                </Button>
                <br />
              </div>

              <div className={classes.linkContainer}>
                <Link to="/user/view-profile">Voltar </Link>
              </div>

              <div></div>
            </div>
          </form>
        </Card>
      </div>
    </div>
  )
}

export default AddressComponent;
